import React, { Component } from 'react';
import ReactMapGL from 'react-map-gl';



const initialViewState = {
    longitude: -73.9667,
    latitude: 40.7634,
    zoom: 14,
    pitch: 60
  };

class Map extends Component {

    state = {
      viewport: {
        width: 400,
        height: 400,
        latitude: 37.7577,
        longitude: -122.4376,
        zoom: 8
      }
    };

    render() {
      return (
        <ReactMapGL
          {...this.state.viewport}
          onViewportChange={(viewport) => this.setState({viewport})}
        />
      );
    }
  }
